import { useState } from 'react';
import * as React from 'react';
import {
  View,
  Text,
  TextInput,
  ScrollView,
  StyleSheet,
  Platform,
} from 'react-native';
import { useNavigation } from '@react-navigation/native';
import { Stepper } from '../../components/Stepper';
import * as Animatable from 'react-native-animatable';
import { Button } from '../../components/Button';

const title = 'My Zip Code';
const description = `Please add your zip code below:`;
const step = 2;

export const AuthZipScreen = () => {
  const navigation = useNavigation();
  const [zip, setZip] = useState('');

  const onChange = (event, selectedZip) => {
    const currentZip = selectedZip || zip;
    setShow(Platform.OS === 'ios');
    setZip(currentZip);
  };

  const [zipMatch, setZipMatch] = React.useState('');

  return (
    <>
      <View style={styles.container}>
        <Animatable.View
          animation="fadeIn"
          delay={500}
          duration={1000}
          style={styles.stepper}
        >
          <Stepper activeStep={step} />
        </Animatable.View>
        <Text style={styles.title}>{title}</Text>
        <Text style={styles.description}>{description}</Text>
        <Animatable.View
          animation="fadeInRight"
          delay={Animations.SPEED_FAST}
          duration={Animations.SPEED_FAST}
          style={styles.inputWrapper}
        >
          <TextInput
            enablesReturnKeyAutomatically={true}
            keyboardType="numeric"
            maxLength={5}
            textAlign="center"
            textContentType="postalCode"
            placeholder="Zip Code"
            value={zip}
            onChangeText={setZip}
            style={styles.input}
          />
        </Animatable.View>

        <Animatable.View
          animation="fadeInUp"
          delay={Animations.SPEED_LONG}
          duration={Animations.SPEED_MED}
        >
          <Button
            arrowDirection="right"
            buttonText="Choose a Password"
            onPress={() => navigation.navigate('AuthPwdScreen')}
            type="solid-green"
            style={styles.resultButton}
          />
        </Animatable.View>
      </View>
    </>
  );
};

const styles = StyleSheet.create({
  container: {
    display: 'flex',
    flexDirection: 'column',
    flex: 1,
    justifyContent: 'space-around',
    width: '100%',
    paddingHorizontal: 30,
    backgroundColor: Colors.WHITE,
  },
  stepper: {
    height: '25%',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    //backgroundColor: '#ffcc00',
  },
  textWrapper: {
    textAlign: 'center',
    //backgroundColor: 'blue',
  },
  title: {
    fontFamily: Fonts.FONT_FACE_TITLE,
    fontSize: Fonts.FONT_SIZE_TITLE,
    textAlign: 'center',
    color: Colors.NAVY,
    lineHeight: Fonts.FONT_SIZE_TITLE,
    //backgroundColor: '#ffcc00',
  },
  description: {
    marginVertical: 6,
    fontFamily: Fonts.FONT_FACE_DESCRIPTION,
    fontSize: Fonts.FONT_SIZE_CAPTION,
    textAlign: 'center',
    color: Colors.NAVY,
    lineHeight: Fonts.FONT_SIZE_DESCRIPTION * 1.5,
    //backgroundColor: 'green',
  },
  inputWrapper: {
    marginBottom: 24,
    // backgroundColor: 'red',
  },
  input: {
    fontFamily: Fonts.FONT_FACE_DESCRIPTION,
    fontSize: Fonts.FONT_SIZE_TITLE,
    color: Colors.NAVY,
    borderRadius: 8,
    height: Dimensions.FORM_HEIGHT,
    maxWidth: 60,
    borderWidth: 1,
    borderColor: Colors.NAVY,
    minWidth: 200,
    paddingHorizontal: 10,
  },
});
